        + ':' + date.getMinutes() ;
        

  return (
    <div className='message'>
      

      <div className="messageInfo">
     
      <div class="message-circle">RR</div>
        
      </div>
      <span>{showTime}</span>
      <div className="messageContent">
        <p>hello
          Krishna
        </p>
       
      </div>
    </div>
  )
}

export default Message
